import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../assets/logo.png';
import './Header.css';

const Header = () => {
  return (
    <header className="header">
      <div className="logo-container">
        <img src={logo} alt="Logo" />
      </div>
      <div className="content">
        <div className="textBox">
          <h2>Discover Our <span>Beautiful</span><br />Wallpaper Collections</h2>
          <p>Transform your space with our stunning collection of wallpapers. From minimalist designs to bold patterns, find the perfect wallpaper to express your style.</p>
          <Link to="/images">Browse Gallery</Link>
        </div>
        <div className="imgBox">
          <img src={logo} alt="Featured Wallpaper" />
        </div>
      </div>
      <ul className="thumb">
        <li><img src={logo} alt="Thumbnail 1" /></li>
        <li><img src={logo} alt="Thumbnail 2" /></li>
        <li><img src={logo} alt="Thumbnail 3" /></li>
      </ul>
    </header>
  );
};

export default Header;
